func TestServersSearch(t *testing.T) {
	RegisterTestingT(t)

	responseBody = `{"result": ` + _serversSearchResultFixture1 + `,"jsonrpc": "2.0","id": 0}`

	mc, err := GetMetalcloudClient("user", "APIKey", httpServer.URL, false)
	Expect(err).To(BeNil())

	ret, err := mc.ServersSearch("*")
	Expect(err).To(BeNil())
	Expect(ret).NotTo(BeNil())

	////check params were sent correctly
	body := (<-requestChan).body

	var m map[string]interface{}
	err2 := json.Unmarshal([]byte(body), &m)
	Expect(err2).To(BeNil())
	Expect(m).NotTo(BeNil())

	params := (m["params"].([]interface{}))
	Expect(params[0]).To(Equal("*"))

	servers := *ret
	Expect(len(servers)).To(Equal(74))
	//check that the search was perormed
	Expect(servers[0].ServerID).To(Equal(1))
	Expect(servers[0].ServerVendor).To(Equal("Dell Inc."))

}

